public class InnerWorkflowWorkflowStepFactory(Action<Humidifier.Transfer.WorkflowTypes.WorkflowStep> factoryAction = null) : SubResourceFactory<Humidifier.Transfer.WorkflowTypes.WorkflowStep>
{

    internal InnerWorkflowCustomStepDetailsFactory CustomStepDetailsFactory { get; set; }

    internal InnerWorkflowCopyStepDetailsFactory CopyStepDetailsFactory { get; set; }

    internal InnerWorkflowDecryptStepDetailsFactory DecryptStepDetailsFactory { get; set; }

    internal InnerWorkflowTagStepDetailsFactory TagStepDetailsFactory { get; set; }

    internal InnerWorkflowDeleteStepDetailsFactory DeleteStepDetailsFactory { get; set; }

    protected override Humidifier.Transfer.WorkflowTypes.WorkflowStep Create()
    {
        var workflowStepResult = CreateWorkflowStep();
        factoryAction?.Invoke(workflowStepResult);

        return workflowStepResult;
    }

    private Humidifier.Transfer.WorkflowTypes.WorkflowStep CreateWorkflowStep()
    {
        var workflowStepResult = new Humidifier.Transfer.WorkflowTypes.WorkflowStep();

        return workflowStepResult;
    }
    public override void CreateChildren(Humidifier.Transfer.WorkflowTypes.WorkflowStep result)
    {
        base.CreateChildren(result);

        result.CustomStepDetails ??= CustomStepDetailsFactory?.Build();
        result.CopyStepDetails ??= CopyStepDetailsFactory?.Build();
        result.DecryptStepDetails ??= DecryptStepDetailsFactory?.Build();
        result.TagStepDetails ??= TagStepDetailsFactory?.Build();
        result.DeleteStepDetails ??= DeleteStepDetailsFactory?.Build();
    }

} // End Of Class

